import React from 'react';
import clsx from 'clsx';

/**
 * Card Component
 * @param {Object} props
 * @param {React.ReactNode} props.children - Content inside the card
 * @param {string} props.className - Additional custom styles
 */
const Card = ({ children, className }) => {
  return (
    <div
      className={clsx(
        'bg-white shadow-md rounded-lg p-6',
        className
      )}
    >
      {children}
    </div>
  );
};

export default Card;
